import React from 'react';
import FirstThingYouFace from './pages/index/FirstThingYouFace';

import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
	palette: {
		primary: {
			main: '#649FFC',
		},
	},
	typography: {
		fontFamily: 'TizTypeFont',
	},
});

const App = props => {
	return (
		<ThemeProvider theme={theme}>
			<FirstThingYouFace />
		</ThemeProvider>
	);
};

export default App;
